    font-weight:bolder;
    font-size:25px;
    letter-spacing: 2px;
    `

    const ParagraphTwo = styled.p`
    padding-top:3rem;
    text-align: left;
    color:black;
    width:75%;
    margin:auto;
    font-size:18px;
    letter-spacing:2px;
    padding-bottom:3rem;
    `
